import React from 'react';
import Signup from '../components/Signup';
import { useHistory } from 'react-router-dom';

function SignupPage() {
  const history = useHistory();
  const handleSuccess = () => {
    history.push('/signin');
  };
  return <Signup onSuccess={handleSuccess} />;
}

export default SignupPage;
